It's a Great Life 




Penny Singleton, Arthur Lake, Larry Simms, Marjorie Ann Mutchie, Daisy and Reggie the Horse.



&quot;IT'S A GREAT LIFE&quot; (Columbia, 1943), directed by Frank R. Strayer,

Number 13 of Chic Young's popular comic strip characters brought-to-life.

Dagwood buys a horse when he is supposed to be buying a house.


